
public class Nestedloop {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int k = 0;
		int j=6;
		
		for (int i=9;i>=-350;i=i-j)
		{
						
				
			//System.out.println("The time in minute" +" " + k);
			
				k++;
				
				
		}
		
		System.out.println("The time in minute" +" " + k);
		

	}

}
